import classes from "../Input/Input.module.css"

const Select = ({props, placeholder, select}) => {
    console.log(props)
    return (
        <div className={classes.input}>
            <select placeholder={placeholder} onChange={()=>console.log("Опция изменена")}>
                {props.map(element => <option key={element.id}>{element.name}</option>)}
            </select>
        </div>
    );
};

export default Select;
